import React from "react";
import Application from "./Application";
import UserProvider, {UserContext} from "./providers/UserProvider";

function App(){
  const user = useContext(UserContext);

  return(
    <UserProvider>
      <Application />
    </UserProvider>


  )

}
export default App;
